import React from 'react'
import { useParams } from 'react-router-dom'

function Loginpage() {
  const {newentry}=useParams()
  return (
    <div>
      <h1>welcome</h1>
      <h1>{
        newentry.map((e)=>{
          return (
            <div>e.email</div>
          )
        })

      }</h1> 
      </div>
  )
}

export default Loginpage
